css:
.conflict-resolved {
  background: rgba(255, 255, 255, 0.2);
}
.conflict-ours {
  background: #3c6281;
}
.conflict-ours.cursor-line {
  background: #2c485e;
}
.conflict-theirs {
  background: #647b42;
}
.conflict-theirs.cursor-line {
  background: #495a30;
}
.conflict-dirty {
  background: #625817;
}
.conflict-dirty.cursor-line {
  background: #8b7e21;
}
